import { Pressable, StyleSheet, Text, TextInput, View } from 'react-native'
import React from 'react'

const AddField = () => {
  return (
    <>
      <View style={styles.container}>
        <TextInput placeholder='Όνομα Χωραφιού' style={styles.inputs}></TextInput>
        <TextInput placeholder='Στρέμματα' style={styles.inputs}></TextInput>
        <TextInput placeholder='Καλλιέργεια' style={styles.inputs}></TextInput>
        <TextInput placeholder='Κωδικός' style={styles.inputs}></TextInput>
        <Text>** Θα σας δωθεί από εμάς</Text>
      </View>
      <View>
        <Pressable style={{width: 100, height: 40, backgroundColor: 'red', zIndex: 1}}><Text>Δημιουργία</Text></Pressable>
      </View>
    </>
  )
}

export default AddField

const styles = StyleSheet.create({
    container: {
        minHeight: '100%',
        backgroundColor: '#EEEEEE',
        padding: 20
    },
    inputs: {
      width: '100%',
      padding: 10,
      marginVertical: 5,
      backgroundColor: '#DEDEDE88',
      borderRadius: 5
    }
})
